import Header from "../../header/Header";
import "./AllRestaurants.scss";
import NavLinkTemplate from "../../layout/button/NavLinkTemplate";
import { Fragment } from "react";
import Footer from "../../footer/Footer";
import RestaurantsGrid from "./RestaurantsGrid";
import React from 'react';


const AllRestaurants:React.FC= () => {
  return (
    <Fragment>
      <Header />
      <h2>Restaurants</h2>
      <div className="categories-div">
       <NavLinkTemplate to={'/restaurants'} content={'All'}></NavLinkTemplate>
       <NavLinkTemplate to={'/restaurants'} content={'New'}></NavLinkTemplate>
       <NavLinkTemplate to={'/restaurants'} content={'Most Popular'}></NavLinkTemplate>
       <NavLinkTemplate to={'/restaurants'} content={'Open Now'}></NavLinkTemplate>
      </div>
      <RestaurantsGrid />
      <hr />
      <Footer />
    </Fragment>
  );
};

export default AllRestaurants;
